import React from 'react'
import airbnb from '../images/airbnb.png'

function Navbar() {
  return (
    <div>
     <img src={airbnb} className="w-24 h-8"/>
     <input type="text" id="first_name" className="bg-gray-50 border-gray-300 txtdark:focus:ring-blue-500" placeholder="John" required />
    </div>
  )
}

export default Navbar
